import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
import "antd/dist/antd.css";
import Header from "./components/Header";
import Dashboard from "./pages/Dashboard";
import Buy from "./pages/Buy";

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="/buy">
          <Buy />
        </Route>
        <Route path="/">
          <Dashboard />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
